import React, { useState, useEffect } from 'react'
import { Container, Title } from './StyleAllTransferences';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Typography from '@material-ui/core/Typography';
import RequestService from './../../services/RequestService';

const AllTransferences = () => {

  const[lista, setLista] = useState([]);

  useEffect(() => {
    const componentDidMount = async () => {

      await RequestService.post("/clients/user/operations", null)
      .then(response => {
        if (!response.ok) {
          return
        }
        return response
      })
      .then(response => response.json())
      .then(data => {
        setLista(data.success)
      })
    };
    componentDidMount();
  }, []);

  return (
    <div>

      <Container>
        <Title>
          Historial de transacciones
        </Title>
        <br /><br />

        {  lista.length === 0 ? (

          <React.Fragment>
            <Typography
              component="span"
              variant="body2"
              color="textPrimary"
              >
                No hay transacciones
              </Typography>

            </React.Fragment>

          ) : (
            <div>
              <List>
                {lista.map(trans => (
                  <div key={trans.id} >
                    <div>
                      <ListItem >

                        <ListItemText
                          primary={

                            <React.Fragment>
                              <Typography
                                component="span"
                                variant="body2"
                                color="textPrimary"
                                >
                                  Origen -
                                </Typography>
                                <br />
                              <Typography
                                component="span"
                                variant="body2"
                                color="textPrimary"
                                >
                                  {" "+trans.origen}
                                </Typography>

                              </React.Fragment>
                            }
                            style={{width: '10%',  justifyContent:'flex-start'}}
                          />


                          <ListItemText
                            primary={
                              <React.Fragment>
                                <Typography
                                  component="span"
                                  variant="body2"
                                  color="textPrimary"
                                  >
                                    Banco -
                                  </Typography>
                                  <br />

                                <Typography
                                  component="span"
                                  variant="body2"
                                  color="textPrimary"
                                  >
                                    {" "+trans.banco_destino}
                                  </Typography>
                                  <br />
                              </React.Fragment>
                            }
                            style={{width: '10%',  justifyContent:'flex-start'}}
                          />

                          <ListItemText
                            primary={
                              <React.Fragment>
                                <Typography
                                  component="span"
                                  variant="body2"
                                  color="textPrimary"
                                  >
                                    Destino -
                                  </Typography>
                                  <br />
                                {" "+trans.destino}
                              </React.Fragment>
                            }
                            style={{width: '10%',  justifyContent:'flex-start'}}
                          />

                          <ListItemText
                            primary={

                              <React.Fragment>
                                <Typography
                                  component="span"
                                  variant="body2"
                                  color="textPrimary"
                                  >
                                    Saldo -
                                  </Typography>
                                  <br />
                                {" "+trans.saldo}
                              </React.Fragment>
                            }
                            style={{width: '10%',  justifyContent:'flex-start'}}
                          />

                          <ListItemText
                            primary={
                              <React.Fragment>
                                <Typography
                                  component="span"
                                  variant="body2"
                                  color="textPrimary"
                                  >
                                    Estado -
                                  </Typography>
                                  <br />
                                {" "+trans.estado}
                              </React.Fragment>
                            }
                            style={{width: '10%',  justifyContent:'flex-start'}}
                          />

                        </ListItem>
                      </div>
                      <Divider />

                  </div>
                ))}
              </List>

            </div>
          )
        }

      </Container>
    </div>

  );
}

export default AllTransferences;
